webpackJsonp([5186775463777],{451:function(A,e){A.exports={data:{site:{siteMetadata:{title:"ourbucketl.ist",author:"Dan Rose & Sophie Mellissa"}},markdownRemark:{id:"C:/Users/danja/OneDrive/Documents/GitHub/ourbucketl.ist/src/pages/ica/index.md absPath of file >>> MarkdownRemark",html:'<blockquote>\n<p>“All journeys have secret destinations of which the traveller is unaware.”</p>\n</blockquote>\n<p>Martin Buber.</p>\n<h2>Huacachina</h2>\n<p>We didn’t actually stay in Ica, opting to stay instead by a little oasis in the desert called Huacachina, just outside of Ica.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/huacachina-23f7aa77d599e73d871ee4b6f0ffc634-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Huacachina"\n        title="Huacachina"\n        src="/static/huacachina-23f7aa77d599e73d871ee4b6f0ffc634-769ec.jpg"\n        srcset="/static/huacachina-23f7aa77d599e73d871ee4b6f0ffc634-d9ef2.jpg 225w,\n/static/huacachina-23f7aa77d599e73d871ee4b6f0ffc634-ac97c.jpg 450w,\n/static/huacachina-23f7aa77d599e73d871ee4b6f0ffc634-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Mainly people come here to ride the sand dunes in a sand buggy and to sandboard. There wasn’t a lot to do here other than this, so we stayed in <a href="https://www.booking.com/hotel/pe/il-vecchio-bungalows.en-gb.html?aid=357026;label=gog235jc-hotel-XX-pe-ilNvecchioNbungalows-unspec-pe-com-L%3Aen-O%3AwindowsS10-B%3Achrome-N%3AXX-S%3Abo-U%3AXX-H%3As;sid=9474d9d1bdb38f3e4d3c5b8158430d7d;dist=0&#x26;sb_price_type=total&#x26;type=total&#x26;">Rochabus Hostel</a> which had a pool and some hammocks to fill our free time.</p>\n<h2>Sandboarding</h2>\n<p>We booked our sandboarding trip through <a href="https://www.findlocaltrips.com/">Find Local Trips</a> which came recommended by the Bolivia/Peru Hop buses, it also appeared to be good value for money. At around 16:00 we strapped into our 14 seater buggy and headed for the dunes. However, initally our buggy got turned away and went back into town, the driver picked up his wife and kid. It seemed that we hadn’t been allowed up there as the buggy wasn’t full. Eventually we got up the first dune, ready for our rollercoaster ride over the dunes and the buggy was super slow. After messing around with it for 10-15 minutes, the driver gave up and called for another buggy; not a great start! The second one was tiny, there was only really room for four people in the back but it had five straps so we had to squeeze in, we didn’t see any other buggy’s with five in the back. The driver didn’t seem to care and he drove up and down the dunes whilst we bumped around squished in the back.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/sand-dunes-a64fb7cea45b150d1665f2d5d3bddda4-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Sand dunes"\n        title="Sand dunes"\n        src="/static/sand-dunes-a64fb7cea45b150d1665f2d5d3bddda4-769ec.jpg"\n        srcset="/static/sand-dunes-a64fb7cea45b150d1665f2d5d3bddda4-d9ef2.jpg 225w,\n/static/sand-dunes-a64fb7cea45b150d1665f2d5d3bddda4-ac97c.jpg 450w,\n/static/sand-dunes-a64fb7cea45b150d1665f2d5d3bddda4-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Finally we reached the first dune to sandboard down, it was steep but wasn’t so high. We had great fun and then went down two smaller ones but pumped full of adrenaline we hoped that they’d get higher! We got back in the buggy, the driver raced up and down the dunes but a few minutes later the axel for the back wheels bent. The driver looked really annoyed but we figured it was because they’d shoved too many of us in the buggy.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/broken-sand-buggy-49cd38fb2d2a1778f48f3762448896fd-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Broken sand buggy"\n        title="Broken sand buggy"\n        src="/static/broken-sand-buggy-49cd38fb2d2a1778f48f3762448896fd-769ec.jpg"\n        srcset="/static/broken-sand-buggy-49cd38fb2d2a1778f48f3762448896fd-d9ef2.jpg 225w,\n/static/broken-sand-buggy-49cd38fb2d2a1778f48f3762448896fd-ac97c.jpg 450w,\n/static/broken-sand-buggy-49cd38fb2d2a1778f48f3762448896fd-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>We had to wait there for around 15 minutes for yet another buggy, we couldn’t sandboard as we couldn’t get back up the dune and the sun was setting fast. An even smaller buggy came and we squashed in to race up the dunes to catch the sunset. As the driver pulled up the sun sank behind the dunes, we’d missed it! We couldn’t believe our bad luck.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/sunset-f7e4f22cbf5c72b68d77a1b3c6ebd3b2-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Sunset"\n        title="Sunset"\n        src="/static/sunset-f7e4f22cbf5c72b68d77a1b3c6ebd3b2-769ec.jpg"\n        srcset="/static/sunset-f7e4f22cbf5c72b68d77a1b3c6ebd3b2-d9ef2.jpg 225w,\n/static/sunset-f7e4f22cbf5c72b68d77a1b3c6ebd3b2-ac97c.jpg 450w,\n/static/sunset-f7e4f22cbf5c72b68d77a1b3c6ebd3b2-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2>Nazca Lines</h2>\n<p>Nazca is two and a half hours away from Huacachina so we caught a <a href="http://www.cruzdelsur.com.pe/">Cruz del Sur</a> bus there and back. These were double the price of the public bus (£6 one way) but they were quicker, more reliable and we were able to watch a film. Historically there have been lots of accidents with flights going over the Nazca Lines, so we did a lot of research and went with <a href="http://www.movilair.com.pe/en/">Movil Air</a> who we’d read had newer planes, more experienced pilots and their planes were bigger, holding twelve passengers not six. We checked in at the ‘airport’ but were sent off in a group of six; we were given a map of the lines and realised we’d been shoved with a different plane company, Air Brag.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/plane-947c3a9eb4634e11ae465c359913383c-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Plane"\n        title="Plane"\n        src="/static/plane-947c3a9eb4634e11ae465c359913383c-769ec.jpg"\n        srcset="/static/plane-947c3a9eb4634e11ae465c359913383c-d9ef2.jpg 225w,\n/static/plane-947c3a9eb4634e11ae465c359913383c-ac97c.jpg 450w,\n/static/plane-947c3a9eb4634e11ae465c359913383c-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>The plane was really small and we had to wear headphones. We’d already been told that the planes tip left and right which can make people sick, so we’d taken anti-sickness tablets before and hadn’t eaten all day, just in case. Before take off, Dan saw an error message come up ‘transponder failed’, the pilot cleared it and continued to the runway. This did not fill us with confidence! We took off and saw each of the ancient geoglyphs from the sky. The plane tipped from side to side so everyone got a good view and it wasn’t long until the woman sat behind me chundered into her sick bag.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/monkey-3d7fa58975cff8a68e853f0904c0593d-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Monkey"\n        title="Monkey"\n        src="/static/monkey-3d7fa58975cff8a68e853f0904c0593d-769ec.jpg"\n        srcset="/static/monkey-3d7fa58975cff8a68e853f0904c0593d-d9ef2.jpg 225w,\n/static/monkey-3d7fa58975cff8a68e853f0904c0593d-ac97c.jpg 450w,\n/static/monkey-3d7fa58975cff8a68e853f0904c0593d-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>The geoglyphs are thought to be from the Nazca culture, between 500 BC and 500 AD. Archaeologists, historians, and mathematicians have all tried to determine the purpose of the Nazca lines; they hypothise that they were either made for the Gods, they are related to astronomy or were created to summon water. Either way they were pretty cool to see from the sky.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/astronaut-899e69318f276e06950ff2f285c95826-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Astronaut"\n        title="Astronaut"\n        src="/static/astronaut-899e69318f276e06950ff2f285c95826-769ec.jpg"\n        srcset="/static/astronaut-899e69318f276e06950ff2f285c95826-d9ef2.jpg 225w,\n/static/astronaut-899e69318f276e06950ff2f285c95826-ac97c.jpg 450w,\n/static/astronaut-899e69318f276e06950ff2f285c95826-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>There was a bit of turbulence in the little plane which felt so much worse than in a big aircraft. We loved seeing the amazing geoglyphs from the air and for £65 the flight was well worth it, but were very pleased to have our feet on the ground again.</p>\n<h2>Our Verdict on Ica</h2>\n<p>We mainly went to Ica to stay in Huacachina for some adrenaline filled sandboarding and sand buggying; sadly this didn’t really happen due to two of the buggy’s breaking on us! The Nazca Lines however did not disappoint and to fly in such a small plane over the geoglyphs was another thing ticked off the bucket list.</p>',frontmatter:{title:"Ica, Peru",date:"May 17, 2018",image:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.7777777777777777,src:"/static/sandboarding-fedd2d98f36da277ac406678a83dc894-47774.jpg",srcSet:"/static/sandboarding-fedd2d98f36da277ac406678a83dc894-45ad6.jpg 480w,\n/static/sandboarding-fedd2d98f36da277ac406678a83dc894-e2fcf.jpg 960w,\n/static/sandboarding-fedd2d98f36da277ac406678a83dc894-47774.jpg 1920w",sizes:"(max-width: 1920px) 100vw, 1920px"}}}}}},pathContext:{slug:"/ica/",previous:{fields:{slug:"/the-amazon-rainforest/"},frontmatter:{title:"The Amazon Rainforest, Peru"}},next:{fields:{slug:"/huaraz/"},frontmatter:{title:"Huaraz, Peru"}}}}}});
//# sourceMappingURL=path---ica-0f2d97decd505ab78480.js.map